import { ScheduleMaintainComponent } from './schedule-maintain.component';
import { Routes } from '@angular/router';
import { ScheduleComponent } from './schedule.component';
import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';

export const scheduleRoute: Routes = [
  {
    path: '',
    component: ScheduleComponent,
    data: {
      defaultSort: 'name,asc',
      authorities: ['ROLE_USER'],
      pageTitle: 'schedule.home.title',
    },
    canActivate: [UserRouteAccessService],
  },
  {
    path: 'maintain',
    component: ScheduleMaintainComponent,
    data: {
      authorities: ['ROLE_USER'],
      pageTitle: 'schedule.create.title',
    },
    canActivate: [UserRouteAccessService],
  },
  {
    path: 'maintain/:id/:readonly',
    component: ScheduleMaintainComponent,
    data: {
      authorities: ['ROLE_USER'],
      pageTitle: 'schedule.maintain.title',
    },
    canActivate: [UserRouteAccessService],
  },
];
